import { Container } from "./styles";
import { Produto } from "../Produto";

import dataBaseProdutos from "../../dataBaseProdutos.js";

const ListaProdutos = () => {
  return (
    <Container>
      {dataBaseProdutos.map((produto) => {
        return <Produto produto={produto} />;
      })}
    </Container>
  );
};
export { ListaProdutos };
